import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux'
import Select from '../../Select';

function FilterHistoric(props) {
    let duels = useSelector(state => state.user.data.duels)
    conse

    const [statusDuel, setStatusDuel] = useState('')

    useEffect(() => {
        changeStatus(duels)
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [statusDuel])

    function changeStatus(c) {
        console.log("Status :: ", c)
        setStatusDuel(c.name)
        props.setFilter("Status", c)
    }

    return (
        <div className="containerFilter">
            <div className="containerSelects">
                <div className="containerSelect">
                    <Select
                        onChange={changeStatus}
                        width={'150px'}
                        placeholder={duels.find(item => item.name === statusDuel) ? statusDuel : 'Status'}
                        options={duels}
                        classNames={'select-class'}
                        name="platform"
                    />
                </div>
            </div>
        </div>
    )
}

export default FilterHistoric;
